INSERT INTO `Test_Type` VALUES
       (0,'Visual Inspection',1,'Preliminary check of board','Check that all components are present on board and that there is no visible damage',0),
       (1,'Resistance Measurement',1,'Measure resistance of analog lines','Test must be completed before attempting to measure ID resistor',2),
       (2,'ID Resistor Measurement',1,'Measure resistance of ID resistor','Should be completed after the general resistance measurement',3),
       (3,'I2C Read/Write',1,'Check I2C read/write along wagon','Test must be completed before BERT for wagon wheel configuration',4),
       (4,'Bit Error Rate Test',1,'Determine quality of data transmission','Needs to be completed after IIC check in order to set up the wagon wheel',5),
       (5,'ADC Self Test',1,'Check ADC functionality','Make sure that the wagon is UNPLUGGED while running this test. Must be run before resistance measurement tests.',1),
       (7,'Registered',0,'Register board in central DB','Passed if board has been registered, failed if we do not want to register the board',99),
       (8,'Zipper Resistance Measurement',0,'Check zipper connections','Connection check for zippers using ID resistor ADC',50),
       (9,'ECON-T Elinks To Engine',1,'Test links from ECON-T to Engine','Test links from ECON-T to Engine',31),
       (10,'ECON-D Elinks To Engine',1,'Test links from ECON-D to Engine','Test links from ECON-D to Engine',32),
       (11,'ECON-T Elinks From Module',1,'Test links from ECON-T from Module','Test links from ECON-T from Module',33),
       (12,'ECON-D Elinks From Module',1,'Test links from ECON-D from Module','Test links from ECON-D from Module',34),
       (13,'Zipper Bit Error Rate Test',0,'BERT for zippers','Measure quality of fast data transmission through zippers using CLK lines from Kria',51),
       (14,'GPIO Test',1,'Tests the GPIO pins','Tests that the GPIO pins behave as expected',21),
       (15,'Analog Test',1,'Tests the Analog pins','Tests that the Analog pins behave as expected',22),
       (16,'Startup Power Check',1,'Check power draw of wagon','Resets ECONs and checks the power draw of each ECON',23),
       (17,'I2C to ECON',1,'Test i2c to each ECON','Check that each ECON on the wagon can be communicated with via i2c',24),
       (18,'Reset Lines Test',1,'Test ECON resets and setup.','Test hard and soft resets of each ECON and then setup the ECONs',25),
       (19,'Config Power Check',1,'Check power draw of wagon without resetting','Checks the power draw of each ECON post config (no resetting)',26),
       (20,'I2C to KRIA',1,'Test i2c to each KRIA','Check that each KRIA can be communicated with via i2c',27),
       (21,'Fast Control to ECONs Test',1,'Check ECON FC','Check that each of the ECONs is receiving fast control',28),
       (22,'Fast Control to Modules Test',1,'Check KRIA FC','Check that each of the KRIAs is receiving fast control',29),
       (23,'Error Pin Test',1,'Tests ECON-T error pin sent to ECON-D','Tests that the ECON-D is receiving the ECON-T error pin',30);
